import React from 'react';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import SignupPage from './pages/SignupPage'; // Import the SignupPage component

function App() {
    return (
        <Router>
            <div className="App">
                <Switch>
                    {/* Other routes */}
                    <Route path="/signup" component={SignupPage}/> {/* Include the SignupPage route */}
                    {/* More routes */}
                </Switch>
            </div>
        </Router>
    );
}

export default App;
